import './style.css';

function HomePage() {
    return(
    <section className='container'>
        <article className='font-large'>
            <img className='img' src='./Assets/icons/laptopHome.svg'></img>
            <h1>Como Landing Pages e Sites</h1>
        </article>
        <div>
            <div className='background-box-1'></div>
        </div>
        <aside>
        </aside>
    </section>)
}

export default HomePage;
